      SELECT + col2 + + col0 / - col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( NULL ) NOT IN ( + + 40 + col1, - 79 + + col0 * col2 * - col1 );
  - name: tab2

outputs:
  - name: q7432.out
    data: |
